import {Navbar, Footer} from '../subscript/universal'

const FAQ = () => {
    return (  
        <div className="FAQ">
             <div id="page-container">
                <div id="content-wrap">
                    <Navbar pageID={3}/>
                    <h2>This is the FAQ page</h2>
                </div>
                <Footer />
            </div>
        </div>
    );
}
 
export default FAQ;
